import React from 'react';
import '../styles/navbar.css';
import logo from "../images/logo.png"

function Navbar() {

    return ( 
        <div class="container">
            <div class="logo">
                <img src= {logo}/>
                <span>IGN</span>
                <span>News</span>
                <span>Videos</span>
                <span>Reviews</span>
                <span>Shows</span>
            </div>
        </div>
     );
}

export default Navbar;
